    it('should detect over-allocated members', () => {
      const overInitiatives: Initiative[] = [
        {
          id: 'initiative-2',
          name: 'Big Project',
          description: 'Test',
          quarter: 'Q1-2025',
          roleRequirements: [],
          assignments: [
            {
              memberId: 'member-2',
              role: 'QA',
              weeksAllocated: 15,
              startWeek: 1,
              isParallel: false,
            },
          ],
        },
