   149→<script setup lang="ts">
   150→import { ref, computed } from 'vue'
   151→import type { Initiative, QuarterConfig, TeamMember, Assignment } from '~/types'
   152→import { checkCarryOver, getInitiativeWarnings, getRoleFulfillment } from '~/utils/capacityCalculator'
   153→import AssignmentCell from './AssignmentCell.vue'
   154→
   155→const props = defineProps<{
   156→  initiative: Initiative
   157→  quarter: QuarterConfig | undefined
   158→  members: TeamMember[]
   159→  draggedMember: TeamMember | null
   160→  allInitiatives: Initiative[]
   161→}>()
   162→
   163→const emit = defineEmits<{
   164→  'edit-assignment': [payload: { initiative: Initiative; assignmentIndex: number }]
   165→  'add-assignment': [initiative: Initiative]
   166→  'drop-member': [payload: { initiative: Initiative; memberId: string; role: string; startWeek: number }]
   167→}>()
   168→
   169→// Drag over state
   170→const isDragOver = ref(false)
   171→const isDragOverWeek = ref<number | null>(null)
   172→
   173→// Computed warnings
   174→const warnings = computed(() =>
   175→  getInitiativeWarnings(props.initiative, props.members, props.allInitiatives, props.quarter?.id || '')
   176→)
   177→
   178→// Computed role fulfillment
   179→const roleFulfillment = computed(() => getRoleFulfillment(props.initiative))
   180→
   181→// Role color mapping
   182→const roleColors: Record<string, string> = {
   183→  BE: 'blue',
   184→  FE: 'green',
   185→  MOBILE: 'orange',
   186→  QA: 'purple',
   187→}
   188→
   189→function getRoleColor(role: string): string {
   190→  return roleColors[role.toUpperCase()] || 'grey'
   191→}
   192→
   193→function getProgressColor(percentage: number): string {
   194→  if (percentage >= 100) return 'success'
   195→  if (percentage >= 75) return 'info'
   196→  if (percentage >= 50) return 'warning'
   197→  return 'error'
   198→}
   199→
   200→function getMember(memberId: string): TeamMember | undefined {
   201→  return props.members.find((m) => m.id === memberId)
   202→}
   203→
   204→function getAssignmentsForWeek(weekNumber: number): Assignment[] {
   205→  return props.initiative.assignments.filter((assignment) => {
   206→    const endWeek = assignment.startWeek + assignment.weeksAllocated - 1
   207→    return weekNumber >= assignment.startWeek && weekNumber <= endWeek
   208→  })
   209→}
   210→
   211→function isAssignmentCarryover(assignment: Assignment, currentWeek: number): boolean {
   212→  if (!props.quarter) return false
   213→  const carryOverInfo = checkCarryOver(assignment, props.quarter)
   214→  return carryOverInfo.carriesOver && currentWeek > props.quarter.totalWeeks - carryOverInfo.carriedWeeks
   215→}
   216→
   217→function getAssignmentIndex(assignment: Assignment): number {
   218→  return props.initiative.assignments.findIndex((a) => a === assignment)
   219→}
   220→
   221→// Drag and drop handlers for the row
   222→function handleDragOver(event: DragEvent) {
   223→  if (props.draggedMember) {
   224→    isDragOver.value = true
   225→    if (event.dataTransfer) {
   226→      event.dataTransfer.dropEffect = 'copy'
   227→    }
   228→  }
   229→}
   230→
   231→function handleDragLeave() {
   232→  isDragOver.value = false
   233→}
   234→
   235→function handleDrop(event: DragEvent) {
   236→  isDragOver.value = false
   237→
   238→  if (!props.draggedMember) return
   239→
   240→  // Find a matching role requirement
   241→  const memberRoles = props.draggedMember.roles
   242→  const matchingRequirement = props.initiative.roleRequirements.find(
   243→    (req) => memberRoles.includes(req.role)
   244→  )
   245→
   246→  const startWeek = 1 // Default to first week when dropping on the row
   247→
   248→  if (matchingRequirement) {
   249→    emit('drop-member', {
   250→      initiative: props.initiative,
   251→      memberId: props.draggedMember.id,
   252→      role: matchingRequirement.role,
   253→      startWeek,
   254→    })
   255→  } else if (props.initiative.roleRequirements.length > 0) {
   256→    // Use first role requirement if no match
   257→    emit('drop-member', {
   258→      initiative: props.initiative,
   259→      memberId: props.draggedMember.id,
   260→      role: props.initiative.roleRequirements[0].role,
   261→      startWeek,
   262→    })
   263→  }
   264→}
   265→
   266→// Week-specific drag handlers
   267→function handleWeekDragOver(event: DragEvent, week: number) {
   268→  if (props.draggedMember) {
   269→    isDragOverWeek.value = week
   270→    if (event.dataTransfer) {
   271→      event.dataTransfer.dropEffect = 'copy'
   272→    }
   273→  }
   274→}
   275→
   276→function handleWeekDragLeave() {
   277→  // Small delay to prevent flickering when moving between cells
   278→  setTimeout(() => {
   279→    isDragOverWeek.value = null
   280→  }, 50)
   281→}
   282→
   283→function handleWeekDrop(event: DragEvent, week: number) {
   284→  isDragOverWeek.value = null
   285→
   286→  if (!props.draggedMember) return
   287→
   288→  // Find a matching role requirement
   289→  const memberRoles = props.draggedMember.roles
   290→  const matchingRequirement = props.initiative.roleRequirements.find(
   291→    (req) => memberRoles.includes(req.role)
   292→  )
   293→
   294→  if (matchingRequirement) {
   295→    emit('drop-member', {
   296→      initiative: props.initiative,
   297→      memberId: props.draggedMember.id,
   298→      role: matchingRequirement.role,
   299→      startWeek: week,
   300→    })
   301→  } else if (props.initiative.roleRequirements.length > 0) {
   302→    // Use first role requirement if no match
   303→    emit('drop-member', {
   304→      initiative: props.initiative,
   305→      memberId: props.draggedMember.id,
   306→      role: props.initiative.roleRequirements[0].role,
   307→      startWeek: week,
   308→    })
   309→  }
   310→}
   311→
   312→function handleAssignmentDragStart(event: DragEvent, assignment: Assignment) {
   313→  if (event.dataTransfer) {
   314→    event.dataTransfer.effectAllowed = 'move'
   315→    event.dataTransfer.setData('application/json', JSON.stringify({
   316→      type: 'assignment',
   317→      initiativeId: props.initiative.id,
   318→      assignment,
   319→    }))
   320→  }
   321→}
